import React,{useState} from "react";
import Select from "react-select";
import Feb22 from "../Charts/feb22";

function MonthData () {
    var MonthList = [
    {
        "appName": "January 2022",
        label: "Jan 2022",
        "path": "/Jan22"
    },
    {
        "appName": "Febrary 2022",
        label: "Feb 2022",
        "path": <Feb22 />
    }
    ];
    
    const [result, monthvalue] = useState(MonthList.path);
    const monthHandler = e =>
    {
        monthvalue(e.path);
    }
    const [label, monthlabel] = useState(MonthList.label);
    const labelHandler = e => {
        monthlabel(e.label);
    }
    return (
        <div>
            <Select options={MonthList} onChange={monthHandler} onChange={lab} />
            <center>
                <h1>{result}{label}</h1>
            </center>
        </div>
    )
}



export default MonthData;
